#","  $Help = \"","powercat - Netcat, The Powershell Version","Github Repository: https://github.com/besimorhino/powercat","","This script attempts to implement the features of netcat in a powershell","script. It also contains extra features such as built-in relays, execute","powershell, and a dnscat2 client.","","Usage: powercat [-c or -l] [-p port] [options]","","  -c  \u003cip\u003e        Client Mode. Provide the IP of the system you wish to connect to.","                  If you are using -dns, specify the DNS Server to send queries to.","            ","  -l              Listen Mode. Start a listener on the port specified by -p.","  ","  -p  \u003cport\u003e      Port. The port to connect to, or the port to listen on.","  ","  -e  \u003cproc\u003e      Execute. Specify the name of the process to start.","  ","  -ep             Execute Powershell. Start a pseudo powershell session. You can","                  declare variables and execute commands, but if you try to enter","                  another shell (nslookup, netsh, cmd, etc.) the shell will hang.","            ","  -r  \u003cstr\u003e       Relay. Used for relaying network traffic between two nodes.","                  Client Relay Format:   -r \u003cprotocol\u003e:\u003cip addr\u003e:\u003cport\u003e","                  Listener Relay Format: -r \u003cprotocol\u003e:\u003cport\u003e","                  DNSCat2 Relay Format:  -r dns:\u003cdns server\u003e:\u003cdns port\u003e:\u003cdomain\u003e","            ","  -u              UDP Mode. Send traffic over UDP. Because it's UDP, the client","                  must send data before the server can respond.","            ","  -dns  \u003cdomain\u003e  DNS Mode. Send traffic over the dnscat2 dns covert channel.","                  Specify the dns server to -c, the dns port to -p, and specify the ","                  domain to this option, -dns. This is only a client.","                  Get the server here: https://github.com/iagox86/dnscat2","            ","  -dnsft \u003cint\u003e    DNS Failure Threshold. This is how many bad packets the client can","                  recieve before exiting. Set to zero when receiving files, and set high","                  for more stability over the internet.","            ","  -t  \u003cint\u003e       Timeout. The number of seconds to wait before giving up on listening or","                  connecting. Default: 60","            ","  -i  \u003cinput\u003e     Input. Provide data to be sent down the pipe as soon as a connection is","                  established. Used for moving files. You can provide the path to a file,","                  a byte array object, or a string. You can also pipe any of those into","                  powercat, like 'aaaaaa' | powercat -c 10.1.1.1 -p 80","            ","  -o  \u003ctype\u003e      Output. Specify how powercat should return information to the console.","                  Valid options are 'Bytes', 'String', or 'Host'. Default is 'Host'.","            ","  -of \u003cpath\u003e      Output File.  Specify the path to a file to write output to.","            ","  -d              Disconnect. powercat will disconnect after the connection is established","                  and the input from -i is sent. Used for scanning.","            ","  -rep            Repeater. powercat will continually restart after it is disconnected.","                  Used for setting up a persistent server.","                  ","  -g              Generate Payload.  Returns a script as a string which will execute the","                  powercat with the options you have specified. -i, -d, and -rep will not","                  be incorporated.","                  ","  -ge             Generate Encoded Payload. Does the same as -g, but returns a string which","                  can be executed in this way: powershell -E \u003cencoded string\u003e","","  -h              Print this help message.","","Examples:","","  Listen on port 8000 and print the output to the conso