ead = $FuncVars[\"Socket\"].Client.EndReceiveFrom($FuncVars[\"StreamReadOperation\"],[ref]$FuncVars[\"EndPoint\"])","      if($StreamBytesRead -eq 0){break}","      $Data = $FuncVars[\"StreamDestinationBuffer\"][0..([int]$StreamBytesRead-1)]","      $FuncVars[\"StreamReadOperation\"] = $FuncVars[\"Socket\"].Client.BeginReceiveFrom($FuncVars[\"StreamDestinationBuffer\"],0,$FuncVars[\"BufferSize\"],([System.Net.Sockets.SocketFlags]::None),[ref]$FuncVars[\"EndPoint\"],$null,$null)","    }","    return $Data,$FuncVars","  }","  function WriteData_UDP","  {","    param($Data,$FuncVars)","    $FuncVars[\"Socket\"].Client.SendTo($Data,$FuncVars[\"EndPoint\"]) | Out-Null","    return $FuncVars","  }","  function Close_UDP","  {","    param($FuncVars)","    $FuncVars[\"Socket\"].Close()","  }","  ############### UDP FUNCTIONS ###############","  ","  ############### DNS FUNCTIONS ###############","  function Setup_DNS","  {","    param($FuncSetupVars)","    if($global:Verbose){$Verbose = $True}","    function ConvertTo-HexArray","    {","      param($String)","      $Hex = @()","      $String.ToCharArray() | % {\"{0:x}\" -f [byte]$_} | % {if($_.Length -eq 1){\"0\" + [string]$_} else{[string]$_}} | % {$Hex += $_}","      return $Hex","    }","    ","    function SendPacket","    {","      param($Packet,$DNSServer,$DNSPort)","      $Command = (\"set type=TXT`nserver $DNSServer`nset port=$DNSPort`nset domain=.com`nset retry=1`n\" + $Packet + \"`nexit\")","      $result = ($Command | nslookup 2\u003e\u00261 | Out-String)","      if($result.Contains('\"')){return ([regex]::Match($result.replace(\"bio=\",\"\"),'(?\u003c=\")[^\"]*(?=\")').Value)}","      else{return 1}","    }","    ","    function Create_SYN","    {","      param($SessionId,$SeqNum,$Tag,$Domain)","      return ($Tag + ([string](Get-Random -Maximum 9999 -Minimum 1000)) + \"00\" + $SessionId + $SeqNum + \"0000\" + $Domain)","    }","    ","    function Create_FIN","    {","      param($SessionId,$Tag,$Domain)","    